data = []

print(len(pred))

def datenormalisation(date):
    datels = date.split('-')
    day_nrmlsed = 1 if int(datels[2][:3]) < 16 else 2
    mth = int(datels[1])
    nmrlsed = day_nrmlsed*mth
    #nmrlsed_scr = (avg/year_occr[datels[2][:4]])
    return nmrlsed


with open('eBirdClean_2020.csv', mode='r', encoding='utf-8') as csv_file:
    csv_reader = csv.reader(csv_file, delimiter=',')
    for rowCSV in csv_reader:
        data.append(rowCSV)

success = 0
fail = 0
for item in pred: # for each bird

    flag = 0
    if item[3]>=0.5: # if pred > 50%
        flag = 1

    for line in data: # within 2020
        if datenormalisation(line[8]) == 20: # if the date falls in the correct time period
            if line[2].strip().lower() == item[0].strip().lower(): #sci name is same
                if flag == 1:
                    success+=1 # add to success
                    break
                else: # did not predict
                    fail+=1 # add to failure
                    break

print("Success Rate: ", success/(fail+success))
print("Failure Rate: ", fail/(fail+success))


